import React from "react";
import { Todo } from "../../utils/types";
import { Container, RowContainer, Title } from "../../ui-kit";

interface TodoListProps {
  todos: [Todo];
}

export const TodoList: React.FC<TodoListProps> = ({ todos }) => {
  return (
    <>
      {todos.map((todo) => (
        <Container>
          <RowContainer>
            <Title>{todo.name}</Title>
          </RowContainer>
        </Container>
      ))}
    </>
  );
};
